import React from "react";

const AssetRow = ({ asset }) => {
    return (
        <tr>
            <td>{asset.inv_number}</td>
            <td>${asset.cost.toFixed(2)}</td>
            <td>{asset.name}</td>
            <td>{asset.model}</td>
            <td>
                <form>
                    <button type="button" class="btn btn-danger mx-2">Sell Asset</button>
                </form>
            </td>
        </tr>
    )
}

export default AssetRow;
